Information
------------------------------

Sex in Class
In Britain, teenage pregnancies and sexually transmitted diseases are among the highest in Western Europe. This documentary reveals how one Lancashire school tackled the issue, by calling in Belgian sexologist and US Goodwill Ambassador Goedele Liekens. She takes on a class of 15 to 16-year-olds, teaching everything from hardcore porn to sexual pleasure - and even trying to turn her unorthodox lessons into an official GCSE. But with homework ranging from girls exploring their vaginas to boys shaving their pubic hair, how will teachers, pupils and parents react?

